\"code\";s:11:\"CkawwhLufL1\";s:7:\"caption\";s:571:\"I’m enchanted to announce my next tour: Taylor Swift | The Eras Tour, a journey through the musical eras of my career (past and present!) The first leg of the tour will be in stadiums across the US, with international dates to be announced as soon as we can! Feeling like the luckiest person alive because I get to take these brilliant artists out on tour with me: @paramore, @radvxz, @phoebebridgers, @girlinred, @whereismuna, @haimtheband, @gracieabrams, @gayle and @owennmusic. I can’t WAIT to see your gorgeous faces out there. It’s been a long time coming 🥰\";s:11:\"preview_url\";s:130:\"https:\/\/cdn.hypeauditor.com\/img\/instagram\/post\/2961894145347154677.jpg?w=200&till=1672625973&sign=c843dd8f9eebe529795c891a63bbd649\";s:11:\"time_posted\";i:1667305318;s:4:\"type\";s:4:\"post\";s:10:\"is_deleted\";b:0;s:9:\"thumbnail\";s:130:\"https:\/\/cdn.hypeauditor.com\/img\/instagram\/post\/2961894145347154677.jpg?w=200&till=1672625973&sign=c843dd8f9eebe529795c891a63bbd649\";s:3:\"day\";s:2:\"01\";s:5:\"month\";s:2:\"11\";s:4:\"year\";s:4:\"2022\";}s:7:\"metrics\";O:8:\"stdClass\":5:{s:11:\"likes_count\";i:5584152;s:14:\"comments_count\";i:0;s:17:\"video_views_count\";i:0;s:2:\"er\";d:2.39;s:7:\"er_mark\";s:4:\"good\";}}i:2;O:8:\"stdClass\":2:{s:5:\"basic\";O:8:\"stdClass\":11:{s:2:\"id\";s:19:\"2953760335023622199\";s:4:\"code\";s:11:\"Cj93WAAuMg3\";s:7:\"caption\";s:441:\"Surprise! I think of Midnights as a complete concept album, with those 13 songs forming a full picture of the intensities of that mystifying, mad hour. However! There were other songs we wrote on our journey to find that magic 13. I’m calling them 3am tracks. Lately I’ve been loving the feeling of sharing more of our creative process with you, like we do with From The Vault tracks. So it’s 3am and I’m giving them to you now. 🌌\";s:11:\"preview_url\";s:130:\"https:\/\/cdn.hypeauditor.com\/img\/instagram\/post\/2953760335023622199.jpg?w=200&till=1672625973&sign=bbe434d6123666bed5e2a096a23e5512\";s:11:\"time_posted\";i:1666335692;s:4:\"type\";s:4:\"post\";s:10:\"is_deleted\";b:0;s:9:\"thumbnail\";s:130:\"https:\/\/cdn.hypeauditor.com\/img\/instagram\/post\/2953760335023622199.jpg?w=200&till=1672625973&sign=bbe434d6123666bed5e2a096a23e5512\";s:3:\"day\";s:2:\"21\";s:5:\"month\";s:2:\"10\";s:4:\"year\";s:4:\"2022\";}s:7:\"metrics\";O:8:\"stdClass\":5:{s:11:\"likes_count\";i:4834704;s:14:\"comments_count\";i:0;s:17:\"video_views_count\";i:0;s:2:\"er\";d:2.07;s:7:\"er_mark\";s:4:\"good\";}}i:3;O:8:\"stdClass\":2:{s:5:\"basic\";O:8:\"stdClass\":11:{s:2:\"id\";s:19:\"2953669479344288504\";s:4:\"code\";s:11:\"Cj9ir4EOrL4\";s:7:\"caption\";s:1144:\"Midnights is a wild ride of an album and I couldn’t be happier that my co pilot on this adventure was @jackantonoff. He’s my friend for life (presumptuous I know but I stand by it) and we’ve been making music together for nearly a decade HOWEVER… this is our first album we’ve done with just the two of us as main collaborators. We’d been toying with ideas and had written a few things we loved, but Midnights actually really coalesced and flowed out of us when our partners (both actors) did a film together in Panama. Jack and I found ourselves back in New York, alone, recording every night, staying up late and exploring old memories and midnights past. We were so lucky to also work with our brilliant collaborators @sam_dew, @sounwave, Lana Del Rey, @jahaansweet, @keanubeats, William Bowery, and @zoeisabellakravitz. @sharp_stick was our excellent engineer. The wonderful and wise @bethgarrabrant took the album photographs. Midnights is a collage of intensity, highs and lows and ebbs and flows. Life can be dark, starry, cloudy, terrifying, electrifying, hot, cold, romantic or lonely. Just like Midnights. Which is out now\";s:11:\"preview_url\";s:130:\"https:\/\/cdn.hypeauditor.com\/img\/instagram\/post\/2953669479344288504.jpg?w=200&till=1672625973&sign=60962df700585b4eb1c7d8cbe027f0cc\";s:11:\"time_posted\";i:1666324861;s:4:\"type\";s:4:\"post\";s:10:\"is_deleted\";b:0;s:9:\"thumbnail\";s:130:\"https:\/\/cdn.hypeauditor.com\/img\/instagram\/post\/2953669479344288504.jpg?w=200&till=1672625973&sign=60962df700585b4eb1c7d8cbe027f0cc\";s:3:\"day\";s:2:\"21\";s:5:\"month\";s:2:\"10\";s:4:\"year\";s:4:\"2022\";}s:7:\"metrics\";O:8:\"stdClass\":5:{s:11:\"likes_count\";i:4464284;s:14:\"comments_count\";i:0;s:17:\"video_views_count\";i:0;s:2:\"er\";d:1.91;s:7:\"er_mark\";s:4:\"good\";}}i:4;O:8:\"stdClass\":2:{s:5:\"basic\";O:8:\"stdClass\":11:{s:2:\"id\";s:19:\"2956333196569703401\";s:4:\"code\";s:11:\"CkHAWEDO3Pp\";s:7:\"caption\";s:400:\"Midnight, what a storied and fabled hour… On this sparkling evening I’ll be releasing my twist on a fairytale we all know. The one about the girl and her step sisters and the clock striking 12… This video is wild, whimsical and created SPECIFICALLY for you, my beloved fans who have paved this shimmering path. Look out for some dazzling cameos! Join us later for a very Bejeweled premiere 💎\";s:11:\"preview_url\";s:130:\"https:\/\/cdn.hypeauditor.com\/img\/instagram\/post\/2956333196569703401.jpg?w=200&till=1672625973&sign=ce40ce265f417f3b8f2d057de7ae52f0\";s:11:\"time_posted\";i:1666642401;s:4:\"type\";s:4:\"post\";s:10:\"is_deleted\";b:0;s:9:\"thumbnail\";s:130:\"https:\/\/cdn.hypeauditor.com\/img\/instagram\/post\/2956333196569703401.jpg?w=200&till=1672625973&sign=ce40ce265f417f3b8f2d057de7ae52f0\";s:3:\"day\";s:2:\"24\";s:5:\"month\";s:2:\"10\";s:4:\"year\";s:4:\"2022\";}s:7:\"metrics\";O:8:\"stdClass\":5:{s:11:\"likes_count\";i:4243177;s:14:\"comments_count\";i:0;s:17:\"video_views_count\";i:0;s:2:\"er\";d:1.81;s:7:\"er_mark\";s:4:\"good\";}}i:5;O:8:\"stdClass\":2:{s:5:\"basic\";O:8:\"stdClass\":11:{s:2:\"id\";s:19:\"2956572374297472424\";s:4:\"code\";s:11:\"CkH2ujqu-2o\";s:7:\"caption\";s:332:\"Bejeweled video is out NOW! Directed by this tired tacky wench. Got to make this with my best friends @haimtheband, greatest of greats @lauradern, icon of burlesque and glamour @ditavonteese, genius and actual dame @patmcgrathreal and my partner in Midnights mayhem @jackantonoff. Love you guys so much. Stay sparkly out there. 😘\";s:11:\"preview_url\";s:130:\"https:\/\/cdn.hypeauditor.com\/img\/instagram\/post\/2956572374297472424.jpg?w=200&till=1672625973&sign=1f21f73a0dcf8947977607f676129eda\";s:11:\"time_posted\";i:1666670913;s:4:\"type\";s:4:\"post\";s:10:\"is_deleted\";b:0;s:9:\"thumbnail\";s:130:\"https:\/\/cdn.hypeauditor.com\/img\/instagram\/post\/2956572374297472424.jpg?w=200&till=1672625973&sign=1f21f73a0dcf8947977607f676129eda\";s:3:\"day\";s:2:\"25\";s:5:\"month\";s:2:\"10\";s:4:\"year\";s:4:\"2022\";}s:7:\"metrics\";O:8:\"stdClass\":5:{s:11:\"likes_count\";i:3677400;s:14:\"comments_count\";i:0;s:17:\"video_views_count\";i:0;s:2:\"er\";d:1.57;s:7:\"er_mark\";s:4:\"good\";}}}}s:14:\"similar_report\";a:0:{}s:14:\"hashtag_report\";a:0:{}s:19:\"frequently_hashtags\";a:0:{}s:17:\"favorite_mentions\";a:5:{i:0;a:2:{s:5:\"title\";s:12:\"jackantonoff\";s:5:\"value\";d:1.78;}i:1;a:2:{s:5:\"title\";s:10:\"primevideo\";s:5:\"value\";d:1.24;}i:2;a:2:{s:5:\"title\";s:5:\"gayle\";s:5:\"value\";d:2.45;}i:3;a:2:{s:5:\"title\";s:12:\"nsaiofficial\";s:5:\"value\";d:1.26;}i:4;a:2:{s:5:\"title\";s:11:\"amazonmusic\";s:5:\"value\";d:1.6;}}s:28:\"demography_by_age_and_gender\";a:3:{s:4:\"male\";a:2:{s:4:\"name\";s:3:\"男\";s:4:\"data\";a:5:{s:8:\"age13-17\";a:2:{s:5:\"title\";s:5:\"13-17\";s:5:\"value\";d:4.16;}s:8:\"age18-24\";a:2:{s:5:\"title\";s:5:\"28-24\";s:5:\"value\";d:13.31;}s:8:\"age25-34\";a:2:{s:5:\"title\";s:5:\"25-34\";s:5:\"value\";d:11.04;}s:8:\"age35-44\";a:2:{s:5:\"title\";s:5:\"35-44\";s:5:\"value\";d:1.93;}s:8:\"age45-64\";a:2:{s:5:\"title\";s:5:\"45-64\";s:5:\"value\";d:0.65;}}}s:6:\"female\";a:2:{s:4:\"name\";s:3:\"女\";s:4:\"data\";a:5:{s:8:\"age13-17\";a:2:{s:5:\"title\";s:5:\"13-17\";s:5:\"value\";d:12.38;}s:8:\"age18-24\";a:2:{s:5:\"title\";s:5:\"28-24\";s:5:\"value\";d:32.2